import React from 'react';
import {parseJsonByString} from "../../../common/utils";
import {Banner, Footer, List} from "../../components";

const pageSchema = parseJsonByString(window.localStorage.schema, {});
const children = pageSchema.children || [];
const map ={Footer,Banner,List};

const render = (index, item) => {
    const components = map
    switch (item.name) {
        case 'Banner':
            return <Banner key={index} schema={item}/>
        case 'Footer':
            return <Footer key={index} schema={item}/>
        case 'List':
            return <List key={index} schema={item}/>
        default:
            return null;
    }
}

export const HomePage = () => {
    return (
        <div>
            {children.map((item, index) => render(index, item))}
        </div>
    );
}
